/*Table structure for table `animals` */
-- This table contains a list of all animals that the AHIS is going to monitor
DROP TABLE IF EXISTS `animals`;

CREATE TABLE `animals` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `animals` */

LOCK TABLES `animals` WRITE;

insert  into `animals`(`id`,`name`) values (1,'Camel'),(2,'Cow'),(3,'Goat'),(4,'Sheep'),(5,'Chicken');

UNLOCK TABLES;





/*Table structure for table `diseases` */
-- This table contains a list of all the animal diseases being monitored by the AHIS
DROP TABLE IF EXISTS `diseases`;

CREATE TABLE `diseases` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` text NOT NULL,
  `animal_id` int(11) NOT NULL,
  FOREIGN KEY (animal_id) REFERENCES animals(id) ON DELETE RESTRICT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `diseases` */

LOCK TABLES `diseases` WRITE;

insert  into `diseases`(`id`,`name`,`animal_id`) values (1,'Bovine Babesiosis',2),(2,'Bovine Tuberculosis',2);

UNLOCK TABLES;





/*Table structure for table `symptoms` */
DROP TABLE IF EXISTS `symptoms`;

CREATE TABLE `symptoms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `description` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `symptoms` */

LOCK TABLES `symptoms` WRITE;

insert  into `symptoms`(`id`,`description`) values (1,'Production of dark red or brown-coloured urine'),(2,'Hypersensitive to sound and touch'),(3,'Intermittent hacking cough');

UNLOCK TABLES;





/*Table structure for table `disease_symptoms` */
DROP TABLE IF EXISTS `disease_symptoms`;

CREATE TABLE `disease_symptoms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `disease_id` INT(11) NOT NULL,
  `symptom_id` INT(11) NOT NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (disease_id) REFERENCES diseases(id) ON DELETE RESTRICT,
  FOREIGN KEY (symptom_id) REFERENCES symptoms(id) ON DELETE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `disease_symptoms` */

LOCK TABLES `disease_symptoms` WRITE;

insert  into `disease_symptoms`(`id`,`disease_id`,`symptom_id`) values (1,1,1),(2,2,3);

UNLOCK TABLES;
